const items = $('Standardize input').all();

const hardReject = [
'sales', 'director', 'assistant', 'recruiter', 'intern',  'stáž', 'graduate', 'account manager', 'executive', 'head', 'representative', 'marketing', 'ředitel', 'vedoucí', 'legal', 'prodej', 'obchod', 'customer success'
];

const contextualReject = [ 
'full-stack', 'fullstack', 'java', 'php', 'c++', 'c#', '.net', 'kotlin', 'rust', 'golang', 'ios', 'android', 'swift', 'react native', 'qa automation', 'test automation', 'kubernetes', 'manual tester', 'developer', 'vývojář', 'engineer', 'inženýr', 'consultant'
];

const saviorKeyword = [
'ai', 'automat', 'n8n', 'agent', 'architect', 'ops', 'operat', 'solution', 'workflow', 'specialist', 'low-code', 'no-code', 'integration', 'product', 'mcp', 'implement', 'bridge', 'process', 'enablement', 'strategy', 'delivery'
]

return items.map(item => {
  const title = (item.json.job_title || "").toLowerCase();

  let newStatus = 'filtered';

  const isHardReject = hardReject.some(word => title.includes(word));
  const isContextualReject = contextualReject.some(word => title.includes(word));
  const hasSavior = saviorKeyword.some(word => title.includes(word));

  if (isHardReject) {
    newStatus = 'rejected';
  }
  else if (hasSavior) {
    newStatus = 'passed_title';
  }
  else if (isContextualReject) {
    newStatus = 'rejected';
  }

  return {
    json: {
      ...item.json,
      status: newStatus,
    }
  };
});

const llmScore = $json.technicalScoreLLM;
const cosineScore = $json.technicalScoreCosine;
const weightedScore = $json.new_technical_score;
const title = $json.job_title.toLowerCase();
const hasAI = title.includes('ai');
const multipliedScore = Math.round(weightedScore * 100);

const maxAllowedDiff = 0.4;
const passMax = 0.5;
const reviewMax = 0.65;

let finalDecision = 'rejected';
let reason = 'Too technical';

const scoreDifference = Math.abs(llmScore - cosineScore);

if (scoreDifference > maxAllowedDiff && llmScore < reviewMax) {
  finalDecision = 'manual_review';
  reason = "LLM and Cosine score difference too big";
}
else if (weightedScore < passMax) {
  finalDecision = 'passed_description';
  reason = 'Not so technical'
}
else if (weightedScore >= passMax && weightedScore <= reviewMax) {
  if (hasAI) {
    finalDecision = 'manual_review';
    reason = 'Mid technical with AI title';
  } else {
    finalDecision = 'rejected';
    reason = 'Mid technical without AI title';
  }
}

return {
  json: {
    ...$json,
    status: finalDecision,
    multipliedScore,
    reason
  }
};

const item = $json;

const technicalScoreLLM = item.technical_score_llm;
const technicalScoreCosine = item.technical_score_cosine;

const weightLLM = 0.7;
const weightCosine = 0.3;

const finalTechnicalScore = (technicalScoreLLM * weightLLM) + (technicalScoreCosine * weightCosine);

return {
  new_technical_score: finalTechnicalScore,
  technicalScoreLLM,
  technicalScoreCosine
};

const rawScore = $json.output?.technical_score_llm;

const min = 0.10;
const max = 0.80;

let adjusted_score = (rawScore - min) / (max - min);

adjusted_score = Math.max(0, Math.min(1, adjusted_score));

return  {
    technical_score_llm: adjusted_score
  }
;

const rawScore = $json.technical_score_cosine;

const min = 0.51;
const max = 0.65;

let adjusted_score = (rawScore - min) / (max - min);

adjusted_score = Math.max(0, Math.min(1, adjusted_score));

return  {
    technical_score_cosine: adjusted_score
  }
;
